-- ----------------------------
-- Table structure for `sys_enclosure`
-- ----------------------------
DROP TABLE IF EXISTS `sys_enclosure`;
CREATE TABLE `sys_enclosure` (
`id`  int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID编号' ,
`dept_id`  int(8) UNSIGNED NULL DEFAULT NULL COMMENT '上级单位ID' ,
`dbName`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '数据库名称' ,
`record_id`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '记录值ID号' ,
`attachName`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '附件名称' ,
`attachUrl`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '附件地址' ,
`upload_id`  int(11) UNSIGNED NULL DEFAULT NULL COMMENT '上传者ID' ,
`upload_date`  datetime NULL DEFAULT NULL COMMENT '上传时间' ,
`state`  int(4) UNSIGNED NULL DEFAULT NULL ,
`ts`  timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '时间戳' ,
`extc1`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`extc2`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`extc3`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`extc4`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`extc5`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`extd1`  datetime NULL DEFAULT NULL ,
`extd2`  datetime NULL DEFAULT NULL ,
`extn1`  float UNSIGNED ZEROFILL NULL DEFAULT NULL ,
`extn2`  float UNSIGNED ZEROFILL NULL DEFAULT NULL ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='附件表'
AUTO_INCREMENT=1

;

-- ----------------------------
-- Records of sys_enclosure
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for `sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
`id`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编号' ,
`type`  char(1) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT '1' COMMENT '日志类型' ,
`title`  varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '日志标题' ,
`create_by`  varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建者' ,
`create_date`  datetime NULL DEFAULT NULL COMMENT '创建时间' ,
`remote_addr`  varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '操作IP地址' ,
`user_agent`  varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '用户代理' ,
`request_uri`  varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '请求URI' ,
`method`  varchar(5) CHARACTER SET utf8 COLLATE utf8_bin NULL DEFAULT NULL COMMENT '操作方式' ,
`params`  text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '操作提交的数据' ,
`exception`  text CHARACTER SET utf8 COLLATE utf8_bin NULL COMMENT '异常信息' ,
PRIMARY KEY (`id`),
INDEX `sys_log_create_by` (`create_by`) USING BTREE ,
INDEX `sys_log_request_uri` (`request_uri`) USING BTREE ,
INDEX `sys_log_type` (`type`) USING BTREE ,
INDEX `sys_log_create_date` (`create_date`) USING BTREE 
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
COMMENT='日志表'

;

